import React from 'react';

import Box from '@mui/material/Box';
import Divider from "@mui/material/Divider";
import NavigateNextIcon from '@mui/icons-material/NavigateNext';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import AodIcon from '@mui/icons-material/Aod';
import AdUnitsIcon from '@mui/icons-material/AdUnits';
import DisplaySettingsIcon from '@mui/icons-material/DisplaySettings';
import ArticleIcon from '@mui/icons-material/Article';
import InfoIcon from '@mui/icons-material/Info';

export default function Setting() {
    
    return (
        <Box sx={{ width: "800px" }} >
            <div>
                <AccountCircleIcon fontSize="medium" sx={{ color:"white", stroke: "black", strokeWidth:1.2 }} />
                
                <p>계정</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }} />
            </div>
            <Divider />
            
            <div>
                <DisplaySettingsIcon fontSize="medium" sx={{ color:"gray" }} />

                <p>화면</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>
            <Divider />

            <div>
                
                <ArticleIcon fontSize="medium" sx={{ color:"black"}} />
                <p>공지사항</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>
            <Divider />

            <div>
                
                <InfoIcon fontSize="medium" sx={{ color:"black"}} />
                <p>정보</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>

        </Box>
    )

}
